import React from 'react';
import logo from '../../photos/logo/logoHD-transformed.png'

const Navbar = () => {
    return (
        <div className='navbar'>
            <div className='logo'>
                <img src={logo} alt="" />
            </div>
        </div>
    );
};

export default Navbar;
